script: |
  super -f text -I q6233.spq | sort > q6233.out

inputs:
  - name: q6233.spq
    data: |
      SELECT - cor0.col1 / cor0.col1 AS col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q6233.out
    data: |
      -1
      -1
      -1
      -1
      -1
      -1
      -1
      -1
      -1
